    console.log(props.items[0]["items"])
    return (
        <section className={props.cat.toLowerCase() + "-section pantry-category"}>
            <PantryCategoryHeader cat={props.cat} catArray={props.catArray}/>
            <PantryItemAddBar cat={props.cat} items={props.enteredItems}/>
            {props.items[0]["items"].map((item) => (
                // (item.category === props.cat && props.cat !== "Saved Items" && item.inStock) ? <PantryItem inStock={true} item={item} cat={props.cat} />
                // : (props.cat === "Saved Items" && !item.inStock) ? <PantryItem inStock={false} item={item} cat={props.cat}/>
                // : null 
                <div>item.category</div>
            ))}
        </section>
    );
}

export default PantryCategoryContainer
